import React from 'react'
import'./Main.css';
import Bargraph from './Bargraph';
import Footer from './Footer';
function Main() {
  return (
    <div className="main">
      <div className='cards'>
      <div class='card1'><div class="rounded1"><img src="https://cdn-icons-png.flaticon.com/128/2150/2150150.png" class="rounded-card1"/></div><div class="card1_content">card1</div></div>
      <div class='card2'><div class="rounded2"><img src="https://cdn-icons-png.flaticon.com/128/2965/2965335.png" class="rounded-card2"/></div><div class="card1_content">card2</div></div>   
      <div class='card3'><div class="rounded3"><img src="https://cdn-icons-png.flaticon.com/128/10196/10196781.png" class="rounded-card3"/></div><div class="card1_content">card3</div></div>
      <div class='card4'><div class="rounded4"><img src="https://cdn-icons-png.flaticon.com/128/9321/9321075.png" class="rounded-card4"/></div><div class="card1_content">card4</div></div>
    </div>
    <div className='mid'>
    <div className='Overview'>
    <Bargraph/>
    </div>
    <div className='Customers'>
      card
    </div>
    </div>
    <Footer />
    </div>
  )
}

export default Main;
